import React, { useState, useEffect } from 'react';
import axios from 'axios';

import { styContainer, styTitle } from './styles';
import { ButtonNavigation, Gap, List, PageNumber } from '../../Component';

const Inventory = () => {
  const [page, setPage] = useState(1);
  const [size, setSize] = useState(5);
  const [data, setData] = useState([]);

  useEffect(() => {
    setData([]);
    axios
      .get(
        `https://mobile.dev.quadrant-si.id/developertest/InventoryItem/inquiry/${page}/${size}`
      )
      .then((res) => {
        setData(res.data.data);
      });
  }, [page, size]);

  return (
    <div className={styContainer}>
    <div>
    </div>
      <h1 className={styTitle}>Inventory Management</h1>
      <div>
        {data.map((e, i) => (
          <div key={i}>
            <List data={e} />
            <Gap height={10} />
          </div>
        ))}
      </div>
      <PageNumber type={'Size'} />
      <ButtonNavigation />
    </div>
  );
};

export default Inventory;
